import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const styles = {
    tableHeader: {
        position: 'sticky',
        top: 0,
        backgroundColor: '#fff',
        zIndex: 2
    },
    summaryRow: {
        backgroundColor: 'yellow',
        fontWeight: 'bold',
        position: 'sticky',
        top: 50,
        zIndex: 1
    }
};

const DataTable = ({ data }) => {
    if (!data.length) {
        console.log('No data to display');
        return null;
    }

    console.log('Displaying data:', data);

    const headers = Object.keys(data[0]);

    return (
        <TableContainer component={Paper}>
            <Table>
                <TableHead>
                    <TableRow style={styles.tableHeader}>
                        <TableCell>Image</TableCell>
                        {headers.filter(header => header !== 'imageUrl').map((header) => (
                            <TableCell key={header}>{header}</TableCell>
                        ))}
                    </TableRow>
                </TableHead>
                <TableBody>
                    {data.map((row, index) => (
                        <TableRow key={index} style={row.asin === "Summary" ? styles.summaryRow : {}}>
                            <TableCell>
                                {row.imageUrl && <img src={row.imageUrl} alt={row.title} style={{ width: 50, height: 50 }} />}
                            </TableCell>
                            {headers.filter(header => header !== 'imageUrl').map((header) => (
                                <TableCell key={header}>{header === 'price' || header === 'revenue' ? `$${parseFloat(row[header]).toLocaleString()}` : row[header]}</TableCell>
                            ))}
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default DataTable;
